    public int firstUniqChar(String s) {
        if (s == null || s.length() == 0)
            return -1;
        if (s.length() == 1) {
            return 0;
        }
        Map<Character, Integer> aplphabate = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
           if (s.charAt(i) != '_'){
               if (aplphabate.get(s.charAt(i)) == null) {
                   aplphabate.put(s.charAt(i), 1);
               } else {
                   s = s.replace(s.charAt(i),'_');
               }
           }
        }

        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) != '_'){
                return i;
            }
        }
        return -1;
    }
